report.g3dmodule.g3dmoduleTage.description=The number of timeticks since the data-module data was last extracted from the switch by the Proxy Agent. This object along with the g3dmoduleintvl object allows the Network Manager to determine the validity of the data-module data in the cache and to control when the Proxy Agent extracts the data from the switch.
