report.g3pktonerec.g3pktonerecTintvl.description=An object containing the interval for which the tone receiver data extracted from the switch is considered valid by the Proxy Agent. When a GET or GET-NEXT request for tone receiver objects is received by the agent it uses the g3tonerecage and g3tonerecintvl objects to determine whether it should refresh the cached tonerecTable. If g3tonerecstmp + g3tonerecintvl is less than the current value of the sysUpTime object then the agent refreshes the tonerecTable cache. In either case it responds to the requests it receives with the data it currently has in the cache.
